import React from 'react';
import styled from 'styled-components';

const Left = () => {
    return (
        <Style>
            <header>
                <i class="fas fa-circle-notch"></i>
                <button> Start again </button>
            </header>
            <div className="row">

            </div>
        </Style>
    );
}

export default Left;

const Style = styled.div`
    background: #121E33;
    min-height: 100vh;
    padding: 20px 50px;
    
    header {
        text-align: right;
        color: #f2ede8;

        i {
            margin-right: 15px;
        }

        button {
            border: none;
            background: none;
            color: #f2ede8;
        }
    }
`
